+ 1 2)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"7\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"145\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"128\" [:div nil [:div [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a value that is a map, whose values are same-length sequentials. One example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries.\\n\\nThe value is rendered in as an [ag-Grid](https://www.ag-grid.com/) component.\\n\\nFor example:\"]]], \"66\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"44\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"5\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"100\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 3}\\n\"}]]], \"48\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"106\" [:div nil [:div [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]]], \"53\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"90\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"112\" [:div nil [:div nil]], \"18\" [:div [:p/code {:code \"(require '[notespace.api :refer [F]])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"36\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"148\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"12\" [:div [:p/code {:code \"(deliver p2 14)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"137\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"13\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"140\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"27\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"136\" [:div nil [:div [:p/markdown \"## Unit tests\\n\\nComing soon.\"]]], \"121\" [:div nil [:div [:big [:big 3]]]], \"62\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"75\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"24\" [:div [:p/code {:code \"(require '[notespace.api :refer [D]])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"76\" [:div nil [:div [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n**Note:** Below we present some specialized macros/functions `F`, `D`, `A`, that are currently used for wrapping futures, delays and atoms so that they would notify Notespace about their state. We are checking the option of avoiding the need of these constructs and getting along with plain futures, delays and atoms.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference. If `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. Otherwise, you should see a mark that says it is still pending.\\n\\nFor example:\"]]], \"35\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"6\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"110\" [:div [:p/code {:code \"^k/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] [:div nil]], \"97\" [:div nil [:div [:p/markdown \"The `A` function allows to define a Clojure atom that informs Notespace when it changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"94\" [:div nil [:div [:p/markdown \"If you called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]]], \"99\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"#'notespace.v3-experiment1-test/a\\n\"}]]], \"130\" [:div nil [:div [:p/markdown \"## Other ways to specify note kinds\\n\\nA note's kinds can also be specified by including it in a vector beginning with a keyword. This is inspired by the approach of [Oz](https://github.com/metasoarous/oz), and should allow some partial compatibility with Oz notebooks.\"]]], \"38\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"122\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"149\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"120\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"70\" [:div nil [:div [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]]], \"144\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"134\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"77\" [:div [:p/code {:code \"(def p1 (promise))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"#'notespace.v3-experiment1-test/p1\\n\"}]]], \"39\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"146\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"63\" [:div [:p/code {:code \"[:hiccup [:big [:big 3]]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"84\" [:div nil [:div [:p/markdown \"### Futures\"]]], \"43\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"125\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/player {:width \"100%\", :height \"100%\", :url \"https://www.youtube.com/watch?v=G512fvK9KXA\"}]]], \"104\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"95\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"102\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div nil]], \"74\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"37\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"142\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"46\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"127\" [:div [:p/code {:code \"^k/hiccup\\n[:p/code {:code \\\"(defn abcd [x] (+ x 9))\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(defn abcd [x] (+ x 9))\"}]]], \"11\" [:div [:p/code {:code \"(def p2 (promise))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"109\" [:div nil [:div [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]]], \"124\" [:div [:p/code {:code \"^k/hiccup\\n(into [:ul]\\n      (for [i (range 9)]\\n        [:li\\n         i \\\" \\\"\\n         [:p/sparklinespot\\n          {:data      (for [j (range 999)]\\n                        (+ (* 0.2 (rand))\\n                           (Math/sin (* i j))))\\n           :limit     100\\n           :svgWidth  100\\n           :svgHeight 20}]]))\", :bg-class \"bg-light\"}] [:div [:ul [:li 0 \" \" [:p/sparklinespot {:data (0.1958523011725012 0.05400655849473504 0.015993421168552225 0.04575534490224558 0.19304460236734208 0.08991645328963759 0.17583546246444404 0.057478469561684765 0.16525658542106775 0.1639000067591474 0.07510098674317545 0.12534985187059836 0.04754463671089326 0.14665508831883797 0.13927397511473874 0.10239266035607325 0.10351009065598954 0.0011188027837620406 0.0032138492629731454 0.16585289346681648 0.011155356648075855 0.1265002759074878 0.1959885700154505 0.03491999041891589 0.12580930899184806 0.1919513632044207 0.1108
